import React from 'react'
import { Grid, Typography } from '@mui/material'

const Settings = () => {
    return (
        <Grid container justifyContent="center">
            <Grid item>
                <Typography variant="h4">Wallete 1</Typography>
            </Grid>
        </Grid>
    )
}

export default Settings
